import React, {useState} from 'react';
import AddFile  from '../utils/AddFile.js';
import { fixture } from '../test/fixture.js';
import styled from "styled-components";
// const apiUrl = "https://run.mocky.io/v3/cbca762d-3f84-4ae4-bb26-79fa774a6c72";
const apiUrl = "";

const Container = styled.div`
    flex-grow: 1;
`;

const Header = styled.header`
    padding: 8px;
    margin-left: auto;
    margin-right: auto;
    font-family: Calibri;
`;

const Section = styled.div`
    margin-left: auto;
    margin-right: auto;
`;

const Button = styled.button`
    border-color: #5FA772;
    background: #5FA772;
    border-style: solid;
    align-items: center;
    font-weight: 500;
    font-family: Calibri;
    display: inline-flex;
    line-height: 1.5;
    padding: 0.rem 1.6rem;
    border-radius: 0.4.rem;
    color: white;
    transition: 0.2s ease;
    border-width: 0.1rem;
    min-height: 2.6rem;
`;

const HomePage = () => {

    const data = fixture;//fileUpload;
    console.log(data);

    const handleSubmit = async () => {
        try {
            const result = await fetch(apiUrl, {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(data)
            });

            if (result.ok) {
                console.log(result);
            } else {
                throw new Error();
            }
        } catch (e) {
            console.log(e);
        }
    };

    return (
		<>
			<Container>
                    <Header>
                        CSV File Uploader
                    </Header>  
                    <Section>
                        <Button onChange={handleSubmit}>Import</Button>
                    </Section>  
            </Container>
		</>
	)
};

export default HomePage;
